/* eslint-disable jsx-a11y/label-has-associated-control */
import React from 'react';
import styled from 'styled-components';

function ResumeCareer({ title, content, isCareer }) {
	return (
		<ComponentWrapper>
			<div className="resumecontentlist-header resume-list-header">
				{title}
			</div>
			<p className="resumecontentlist-guide">
				{content.split('<br/>').map((line) => (
					<>
						{line}
						<br />
					</>
				))}
			</p>
			{isCareer && (
				<button type="button" className="banner">
					<div className="banner-content">
						<div className="banner-content-text">
							<p>내 경력 정보를 한 번에 불러올까요?</p>
							<p className="Banner_subTitle__eINOg">
								기억 안 나는 경력 정보, 알아서 채워드려요!
							</p>
						</div>
						<div className="banner-content-btn">
							<strong>내 경력 한눈에 모아보기</strong>
							<svg width="12" height="12">
								<path
									fill="currentColor"
									d="M3.345 9.72a.75.75 0 0 0 1.06 1.06l4.25-4.25a.75.75 0 0 0 0-1.06l-4.25-4.25a.75.75 0 0 0-1.06 1.06L7.065 6l-3.72 3.72z"
								/>
							</svg>
						</div>
					</div>
				</button>
			)}

			<div className="ResumeContentList_ResumeContentList__body__TcdNe">
				<button
					type="button"
					className="resumecontentlist-body-btn-add"
				>
					+ 추가
				</button>
				<ul className="SortableList_SortableList__Iecvd">
					<li className="SortableItem_SortableItem__Ppo2a careers list-group-item">
						<div className="DragHandler_DragHandler__0rbSF portlet-handler">
							<div className="DragHandler_DragHandler_handler__D_XV_" />
						</div>
						<div className="CareerItem_CareerItem__9EzY3 clearfix">
							<div>
								<div>
									<div className="Period_Period__datetime__bxg1v">
										<div className="Period_Period__form__QYZaw">
											<div className="Period_Period__form__start__ADV_L">
												<input
													name="startYear"
													field="start_year"
													type="text"
													maxLength="4"
													className="year"
													placeholder="YYYY"
													value=""
												/>
												<span>
													.
													<input
														name="startMonth"
														type="text"
														maxLength="2"
														className="month"
														placeholder="MM"
														value=""
													/>
												</span>
											</div>
										</div>
										<div className="Period_Period__form__end__3L8s1">
											<span className="Period_Period__form__end_delimiter___FR4z">
												-
											</span>
											<div className="Period_Period__form__QYZaw">
												<input
													name="endYear"
													type="text"
													maxLength="4"
													className="Period_Period__form_control__48nLY year"
													placeholder="YYYY"
													value=""
												/>
											</div>
											<div className="Period_Period__form__QYZaw">
												<span>.</span>
												<input
													name="endMonth"
													type="text"
													maxLength="2"
													className="Period_Period__form_control__48nLY month"
													placeholder="MM"
													value=""
												/>
											</div>
											<span className="Period_Period__datetime_isRequired__lQg0J">
												*
											</span>
										</div>
									</div>
									<div className="Period_Period__form_checkbox__Khc7G">
										<input
											type="checkbox"
											name="checked"
											value="false"
										/>
										<label
											htmlFor="checked"
											className="Period_Period__form_checkbox_label__btW7m"
										>
											현재 재직중
										</label>
									</div>
								</div>
							</div>
							<div>
								<div className="SearchModalInput_SearchModalInput__rw2Mu">
									<form action=".">
										<div className="SearchModalInput_SearchModalInput__inputWrapper__toXeN">
											<input
												type="text"
												className="SearchModalInput_SearchModalInput__input__Iw_P2 resume-input SearchModalInput_SearchModalInput__input__placeholder__38M_r"
												placeholder="회사명"
												name="maintitle"
											/>
										</div>
									</form>
								</div>
								<div>
									<input
										className="ResumeInput_ResumeInput__spGWu resume-input title careers"
										type="text"
										maxLength="255"
										placeholder="부서명/직책"
										name="title"
									/>
								</div>
								<div className="ResumeContentList_ResumeContentList__UJ_Ct ResumeContentList_projects__B76_t">
									<div className="ResumeContentList_ResumeContentList__body__TcdNe">
										<button
											type="button"
											className="ResumeContentList_ResumeContentList__body_btn_add__PGwYZ"
										>
											+ 주요 성과 추가
										</button>
									</div>
								</div>
							</div>
							<button
								type="button"
								className="BtnDelete_BtnDelete__eEe1N btn-delete"
							>
								<i className="icon-close" />
							</button>
						</div>
					</li>
				</ul>
			</div>
		</ComponentWrapper>
	);
}
const ComponentWrapper = styled.div`
	.SortableItem_SortableItem__Ppo2a {
		margin: 0;
		padding: 30px;
		position: relative;
		border-radius: 0;
		border: none;
		border-bottom: 1px solid #f1f1f1;
		background-color: transparent;
	}
	.DragHandler_DragHandler__0rbSF {
		position: absolute;
		cursor: move;
		display: none;
		top: 35px;
		left: 10px;
